//Variables y constantes
const nombre = "Rocío";
const apellido = "Cellini";

let valorDado = 5; //si no estamos seguros de si lo vamos a cambiar o no.
valorDado = 4;

console.log(nombre, apellido, valorDado);

if ( true ){
    
    const nombre = 'Peter';
    console.log(nombre, valorDado)
}

console.log(valorDado);
